  const { id } = useParams();
 

 
  return <div>
    <Link className="btn btn-primary" to={`/Customer/CustomerViewTutorials/${id}`}> Back to Tutorials</Link>
    <video width='100%' height='500' controls>
      <source  src={`http://localhost:4002/${id}`}/>
    </video>
  </div>;
}

